import React from 'react';
import Filters from './components/Filters.js'
import './Style.css';
import Cards from './components/Cards.js';



function Cards_Gallery() {
    return (
    <div class="container">
        <div class="row">
                <div class="col-3">
                    <Filters/>
                </div> 
                <div class="col-8">
                    <div class="row">
                        <div className='col-4'><Cards/></div>
                        <div className='col-4'><Cards/></div>
                        <div className='col-4'><Cards/></div>
                    </div>                  
                </div> 
            <div class="col"><button className='btn btn-light'>COl3</button></div> 
        </div>
    </div>
    );
  }
  
  export default Cards_Gallery;
